import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import classes from "../styles/Resources.module.css";

export default function Resources() {

  const myStyle = {
    backgroundImage: "url(" +
        "https://www.pexels.com/photo/water-dews-on-green-leaves-38012/.jpg" + ")",
    backgroundSize: 'cover',
    alt: 'Photo by Hilary Halliwell from Pexels',
  };

  return (
    <div>
      <Navbar />
      <div className={classes.header}>
        <h1 className={`${classes.shadowsIntoLightRegular} ${classes.title}`}>Resources</h1>
      </div>
      <div className={classes.topBanner} style={myStyle}></div>
        <div className={classes.subHeader}>
          <p>Below you will find a list of resources meant to offer knowledge, tools, access to community, or crisis help. These are trusted resources that may offer support for your mental health and wellbeing. Please note that these resources are not to be considered direct treament and <span className={classes.underline}>are not a substitute for therapy</span>.</p>
        </div>

      <Footer />
    </div>
  )
}
